import React from 'react';
import styled , {keyframes} from "styled-components";
import './Text.css'

export default function TextAnm(){
    return(
      <>
        <Wrapper className='text' data-text=" Mo. Kaif Siddique">Mo.<span style={{margin:"0 5px 0 5px"}}>Kaif</span>Siddique  </Wrapper>
        <Wrapper><h1>I am Full Stack <span style={{color:"tomato"}}>Web Developer</span> , FrontEnd specialist </h1>
        <h2>Check out my portfolio and projects</h2></Wrapper>
      </>
    )
}

const animation = keyframes `
0%{
  width:0%;
}
90%{
  width:41%;
}
`
const Wrapper = styled.span`
   display:inline-block;
  animation-name : ${animation};
  animation-duration : 4s;
  animation-iteration-count: infinite;
  animation-delay: 0ms;
`
